HITCHIP MapData::IsHitBoxAndMapChip(MYRECT rect)
{
	int x, y;
	// `
	int l, t, r, b;		// (left,top) - E(right,bottom)
	l = rect.x;
	t = rect.y;
	r = rect.x + rect.w;
	b = rect.y + rect.h;

	HITCHIP hit;

	// boxW`EW}bv`bvAs
	for (y = t / CHIPSIZE_H; y <= b / CHIPSIZE_H; y++)
	{
		for (x = l / CHIPSIZE_W; x <= r / CHIPSIZE_W; x++)
		{
			// (x,y)A}bv`bvWi`bvPj
			// u`bvH
			int chip_no = CheckHitMapChip(x, y);
			if (chip_no != 0)
			{
				hit.chip_no = chip_no;
				hit.x = x;
				hit.y = y;

				// `bvB
				return hit;
			}
		}
	}

	hit.chip_no = -1;
	return hit; // 
}


void MapData::BreakMapChip(HITCHIP hitChip)
{	
	_gMapData[LAYER_MAP][hitChip.y * MAPSIZE_W + hitChip.x] = 0;
}









void MapData::SetGimmickChip()
{
	int i = 0;
	GIMMICK_DATA doorData = GetDoorData(_stageNo, i);
	while (doorData.id != -1)
	{
		_gMapData[LAYER_MAP][doorData.y * MAPSIZE_W + doorData.x] = CHIP_DOOR + 1;
		i++;
		doorData = GetDoorData(_stageNo, i);
	}
}



