void MapData::StartBossBattle()
{
	if (_bossBattle != 1) {
		_startBossCnt = 16;
		_bossBattle = 1;
		_barrierChip.clear();
	}	
}

void MapData::SetBossBarrier(VECTOR barrierPos)
{
	VECTOR b = barrierPos;
	_barrierChip.push_back(b);
	_isSetBossBarrier = 1;
}

void MapData::VanishBossBarrier()
{
	_isSetBossBarrier = -1;
}





void MapData::Process()
{
	if (_gimmickID != -1) {
		_vanishCnt++;
		int vanishDone = 0;
		if (_vanishCnt >= 4) {
			int i = 0;
			GIMMICK_DATA doorData = GetDoorData(_stageNo, i);
			while (doorData.id != -1)
			{
				if (doorData.id == _gimmickID) {
					_gMapData[LAYER_MAP][doorData.y * MAPSIZE_W + doorData.x] ++;

					if (_gMapData[LAYER_MAP][doorData.y * MAPSIZE_W + doorData.x] > CHIP_DOOR + 4) {
						_gMapData[LAYER_MAP][doorData.y * MAPSIZE_W + doorData.x] = 0;
						vanishDone = 1;
					}
				}
				i++;
				doorData = GetDoorData(_stageNo, i);
			}
		}

		if (vanishDone == 1) {
			_gimmickID = -1;
		}
	}


	if (_bossBattle == 1) {
		BossBattleProcess();
	}


}


void MapData::BossBattleProcess()
{
	if (_startBossCnt > 0) {
		int n = _startBossCnt / 4;
		for (int x = 210; x < 212; x++) {
			for (int y = 40; y < 44; y++) {
				_gMapData[LAYER_MAP][y * MAPSIZE_W + x] = CHIP_DOOR + 1 + n;
			}
		}
		
		_startBossCnt--;

		// H}bv`bvZbgI
		// {XUJn
		if (_startBossCnt == 0) {
			boss->SetBossBattle();
		}
	}
	else {

		if (_isSetBossBarrier == 1) {
			int n = _barrierCnt / 4;
			for (auto barrier : _barrierChip) {
				int x = barrier.x;
				int y = barrier.y;
				_gMapData[LAYER_MAP][y * MAPSIZE_W + x] = CHIP_DOOR + 1 + n;
			}
			_barrierCnt--;
			if (_barrierCnt < 0) {
				_barrierCnt = 0;
				_isSetBossBarrier = 0;
			}
		}
		else if (_isSetBossBarrier == -1) {
			int n = _barrierCnt / 4;
			for (auto barrier : _barrierChip) {
				int x = barrier.x;
				int y = barrier.y;
				_gMapData[LAYER_MAP][y * MAPSIZE_W + x] = CHIP_DOOR + 1 + n;
			}
			_barrierCnt++;
			if (_barrierCnt > 15) {
				_barrierCnt = 15;
				_isSetBossBarrier = 0;

				for (auto barrier : _barrierChip) {
					int x = barrier.x;
					int y = barrier.y;
					_gMapData[LAYER_MAP][y * MAPSIZE_W + x] = 0;
				}
				_barrierChip.clear();
			}
		}
	}
}




